import React from "react";
import "./App.css";
import Routes from "./Routes";
import { Link, useHistory} from "react-router-dom";
import { Nav, Navbar, NavItem } from "react-bootstrap";

function App() {
  return (
    <div className="App container">
      <Navbar fluid collapseOnSelect>
        <Navbar.Header>
          <Navbar.Brand>
            <Link to="/">Home</Link>
          </Navbar.Brand>
          <Navbar.Toggle />
        </Navbar.Header>
      </Navbar>
      <Routes />
    </div>
  );
}

export default App;
